"use strict";(self.webpackChunkajudafacitysistemas=self.webpackChunkajudafacitysistemas||[]).push([[6173],{2980:(t,s,a)=>{a.r(s),a.d(s,{assets:()=>c,contentTitle:()=>r,default:()=>g,frontMatter:()=>e,metadata:()=>i,toc:()=>p});var o=a(4848),n=a(8453);const e={title:"Como configurar senhas de retirada?"},r=void 0,i={id:"cadastros/como-configurar-senhas-de-retirada-",title:"Como configurar senhas de retirada?",description:"<div dangerouslySetInnerHTML={{ html: `",source:"@site/docs/cadastros/como-configurar-senhas-de-retirada-.mdx",sourceDirName:"cadastros",slug:"/cadastros/como-configurar-senhas-de-retirada-",permalink:"/ajudafacitysistemas/docs/cadastros/como-configurar-senhas-de-retirada-",draft:!1,unlisted:!1,editUrl:"https://github.com/ajudafacity/ajudafacitysistemas/edit/main/docs/cadastros/como-configurar-senhas-de-retirada-.mdx",tags:[],version:"current",frontMatter:{title:"Como configurar senhas de retirada?"},sidebar:"tutorialSidebar",previous:{title:"Como configurar o Facity Impressor?",permalink:"/ajudafacitysistemas/docs/cadastros/como-configurar-o-facity-impressor-"},next:{title:"Como configurar taxas de entrega (bairro)?",permalink:"/ajudafacitysistemas/docs/cadastros/como-configurar-taxas-de-entrega--bairro--"}},c={},p=[];function l(t){return(0,o.jsx)(o.Fragment,{children:(0,o.jsx)(o.Fragment,{children:(0,o.jsx)("div",{dangerouslySetInnerHTML:{__html:'\n  \n<p></p>\n\n\n\n<p class="has-small-font-size"><strong>Passo 1:</strong> Acesse o <strong>Facity Controle</strong> no seu computador e fa\xe7a o <strong>login</strong> na sua conta.</p>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="900" height="547" src="https://blog.facity.com.br/wp-content/uploads/2023/08/image-5.png" alt="" class="wp-image-1470" srcset="https://blog.facity.com.br/wp-content/uploads/2023/08/image-5.png 900w, https://blog.facity.com.br/wp-content/uploads/2023/08/image-5-300x182.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/08/image-5-768x467.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/08/image-5-720x438.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 2:</strong> No menu lateral esquerdo, clique em <strong>&#8220;Impressoras de Terminal&#8221;</strong>.</p>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="440" src="https://blog.facity.com.br/wp-content/uploads/2023/08/1-2-1024x440.png" alt="" class="wp-image-1471" srcset="https://blog.facity.com.br/wp-content/uploads/2023/08/1-2-1024x440.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/08/1-2-300x129.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/08/1-2-768x330.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/08/1-2-720x310.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/08/1-2.png 1309w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 3:</strong> Clique em <strong>&#8220;Editar Terminal&#8221;</strong> e selecione as op\xe7\xf5es desejadas. Em seguida, clique em <strong>&#8220;OK&#8221;</strong> para salvar. Isso criar\xe1 a op\xe7\xe3o de senha de retirada.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/09/certo.png" alt="" class="wp-image-1482" width="1005" height="839" srcset="https://blog.facity.com.br/wp-content/uploads/2023/09/certo.png 739w, https://blog.facity.com.br/wp-content/uploads/2023/09/certo-300x250.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/09/certo-575x480.png 575w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 4:</strong> Entre no <strong>Facity POS </strong>e clique onde a seta indica na imagem abaixo:</p>\n\n\n\n<p> </p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/09/certo1.png" alt="" class="wp-image-1483" width="991" height="1351" srcset="https://blog.facity.com.br/wp-content/uploads/2023/09/certo1.png 443w, https://blog.facity.com.br/wp-content/uploads/2023/09/certo1-220x300.png 220w, https://blog.facity.com.br/wp-content/uploads/2023/09/certo1-352x480.png 352w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 5:</strong> Ap\xf3s clicar, voc\xea ser\xe1 redirecionado para a seguinte p\xe1gina. Clique em <strong>&#8220;Senhas de Retirada&#8221;</strong> para configurar.<br></p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/09/certo2.png" alt="" class="wp-image-1484" width="996" height="835" srcset="https://blog.facity.com.br/wp-content/uploads/2023/09/certo2.png 740w, https://blog.facity.com.br/wp-content/uploads/2023/09/certo2-300x251.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/09/certo2-573x480.png 573w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 6:</strong> Na pr\xf3xima tela, voc\xea pode alterar os n\xfameros das senhas usando os s\xedmbolos <strong>&#8220;+&#8221;</strong> e<strong> &#8220;-&#8220;</strong> ou digitando os n\xfameros diretamente no espa\xe7o fornecido.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/09/certo3.png" alt="" class="wp-image-1485" width="997" height="628" srcset="https://blog.facity.com.br/wp-content/uploads/2023/09/certo3.png 845w, https://blog.facity.com.br/wp-content/uploads/2023/09/certo3-300x189.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/09/certo3-768x484.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/09/certo3-720x453.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 7:</strong> Por fim, clique em <strong>&#8220;Confirmar&#8221;</strong> para finalizar a configura\xe7\xe3o. Lembre-se de que, sempre que desejar alterar as senhas no painel, voc\xea deve voltar a esta configura\xe7\xe3o.</p>\n\n\n\n<p></p>\n\n\n\n<p class="has-small-font-size">Com esses simples passos, voc\xea configurou com sucesso senhas de retirada no <strong>Facity POS</strong>. Agora voc\xea pode desfrutar de uma experi\xeancia mais segura e organizada em seu sistema.</p>\n\n\n\n<p class="has-small-font-size">Esperamos que este guia tenha sido \xfatil! Se tiver alguma d\xfavida, n\xe3o hesite em entrar em <strong>contato conosco</strong>.</p>\n\n\n\n<p class="has-small-font-size"><br></p>\n\n'}})})})}function g(t={}){const{wrapper:s}={...(0,n.R)(),...t.components};return s?(0,o.jsx)(s,{...t,children:(0,o.jsx)(l,{...t})}):l()}},8453:(t,s,a)=>{a.d(s,{R:()=>r,x:()=>i});var o=a(6540);const n={},e=o.createContext(n);function r(t){const s=o.useContext(e);return o.useMemo((function(){return"function"==typeof t?t(s):{...s,...t}}),[s,t])}function i(t){let s;return s=t.disableParentContext?"function"==typeof t.components?t.components(n):t.components||n:r(t.components),o.createElement(e.Provider,{value:s},t.children)}}}]);